COVID-19 RESPONSE

We want to thank each and every donor that helped provide food and supplies for local refugee families during Greece's Covid-19 lockdown. During quarantine, we distributed necessary supplies, nonperishable food items, and fresh groceries to more than 310 people in Athens and Ritsona Refugee Camp. Additionally, we provided support to isolated families that were uninformed about the required documentation needed to go to the supermarket, make necessary errands, etc. During the Easter time, we also distributed special food boxes for families to enjoy the holiday. Thank you again to everyone who helped make this possible!

